import React from 'react'; // Import the Component component from React
import ProjectCarousel from './../projectPage/projectCarousel.js'
import SlideImage from './../projectPage/slideImage.js'

function Beatbox(props) {
  const slides = [
    <SlideImage
      src={require('./../../content/projects/homeAutomation/1.jpg')}
    />,
    <SlideImage
      src={require('./../../content/projects/homeAutomation/2.jpg')}
    />,
    <SlideImage
      src={require('./../../content/projects/homeAutomation/3.jpg')}
    />,
    <SlideImage
      src={require('./../../content/projects/homeAutomation/4.jpg')}
    />,
    <SlideImage
      src={require('./../../content/projects/homeAutomation/5.jpg')}
    />,
    <SlideImage
      src={require('./../../content/projects/homeAutomation/6.jpg')}
    />,

  ]

  const slideInfo = [
    {
      text:
        [
          'Lights',
          "Our security system is made up of lights, cameras and motion sensors. The entire perimeter of the house has security lighting, with the brightest one being 5000 Watts. The camera system is designed such that each camera is watched by at least one other camera, leaving no blind spots. Motion sensors give and indication of lurking, allowing detection before entry rather than only after. All of the cameras, motion sensors and lights can be accessed through the IndigoDomo home automation system we installed."

        ],
      width:'30vw',
      top:'10vh',
    },
    {
      text:[
        'Camera',
      ],
      width:'30vw',
      top:'10vh',
    },
    {
      text:[
        'Motion',
      ],
      width:'30vw',
      top:'10vh',
    },
    {
      text:
        [
          'Sense',
          "Our security system is made up of lights, cameras and motion sensors. The entire perimeter of the house has security lighting, with the brightest one being 5000 Watts. The camera system is designed such that each camera is watched by at least one other camera, leaving no blind spots. Motion sensors give and indication of lurking, allowing detection before entry rather than only after. All of the cameras, motion sensors and lights can be accessed through the IndigoDomo home automation system we installed."

        ],
      width:'30vw',
      top:'10vh',
    },
    {
      text:[
        'Activate',
      ],
      width:'30vw',
      top:'10vh',
    },
    {
      text:[
        'Actuate',
      ],
      width:'30vw',
      top:'10vh',
    },
  ]

  return(
    <div>
      <ProjectCarousel
        projectKey='homeAutomation'
        slides={slides}
        slideInfo={slideInfo}
      />
    </div>
  )
}

export default Beatbox;
